    public List<String> wordSubsets(String[] words1, String[] words2) {

        List<String> output = new ArrayList<>();
        Map<Character, Integer> inputMap = new HashMap<>();
        for(String word2 : words2){
            Map<Character, Integer> tempMap = new HashMap<>();
            for (int i = 0; i < word2.length(); i++) {
                Character c = word2.charAt(i);
                if(tempMap.containsKey(c)){
                    tempMap.put(c, tempMap.get(c)+1);
                }else {
                    tempMap.put(c, 1);
                }
            }

            for(Map.Entry<Character, Integer> entry : tempMap.entrySet()){
                if(inputMap.containsKey(entry.getKey())){
                    if(entry.getValue()>inputMap.get(entry.getKey())){
                        inputMap.put(entry.getKey(), entry.getValue());
                    }
                }else {
                    inputMap.put(entry.getKey(), entry.getValue());
                }
            }
        }


        for(String word1 : words1){
            boolean addtooutput = true;

            for(Map.Entry<Character, Integer> entry : inputMap.entrySet()){
                Character c = entry.getKey();
                if(word1.indexOf(c)>-1 && word1.chars().filter(ch -> ch==c).count() >= entry.getValue()){
                    continue;
                }
                else {
                    addtooutput = false;
                    break;
                }
            }
            if(addtooutput){
                output.add(word1);
            }
        }
        return output;
    }
